/**
 * 242. Valid Anagram
 * https://leetcode.com/problems/valid-anagram
 */

#include "my_util.hpp"

using namespace std;

class Solution {
public:
    bool isAnagram(string s, string t) {
        if (s.size() != t.size()) {
            return false;
        }

        int mapSize = 0;
        int map[256] = {0};
        for (char c: s) {
            if (map[c] == 0) {
                ++mapSize;
            }
            ++map[c];
        }


        for (char c: t) {
            --map[c];
            if (map[c] == 0) {
                --mapSize;
            } else if (map[c] < 0) {
                return false;
            }
        }

        return mapSize == 0;
    }
};

int main() {
    print_v(Solution().isAnagram("anagram", "nagaram"));
    print_v(Solution().isAnagram("rat", "car"));

    string s = "";
    string t = "";
    print_v(Solution().isAnagram(s, t));
}
